import React from 'react';
import '../style/button.css';

function Button({ btnName, btnType }) {
  const btnHeader = 'header-btn';

  if (btnType === btnHeader) {
    return (
      <button
        className="page-btn"
      >
        { btnName }
      </button>
    );
  } else {
    return (
      <button
        className="page-btn"
      >
        { btnName }
      </button>
    );
  }
}

export default Button;
